INSERT INTO `wp_posts` VALUES (27,1,'2021-02-27 04:20:56','2021-02-27 04:20:56','<!-- wp:cover {\"url\":\"https://northernsuburbsfencing.local/wp-content/uploads/2021/02/semi-frameless.jpg\",\"id\":25,\"hasParallax\":true,\"dimRatio\":40,\"customOverlayColor\":\"#5260f2\",\"className\":\"home-hero primary-hero\"} -->\n<div class=\"wp-block-cover has-background-dim-40 has-background-dim has-parallax home-hero primary-hero\" style=\"background-image:url(https://northernsuburbsfencing.local/wp-content/uploads/2021/02/semi-frameless.jpg);background-color:#5260f2\"><div class=\"wp-block-cover__inner-container\"><!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading -->\n<h2>Welcome to Northern Suburbs Fencing</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>At Northern Suburbs Fencing, we offer our clients affordable, full-service personalized solutions to all their fencing requirements. We specialize in glass and pool fencing and have professional installers for timber, Colorbond, chainwire, and much more. If youâre looking for fencing on the north side of Brisbane, weâre the name you can trust. With professionals on staff with more than 20 years of experience, no project is too tricky. We pride ourselves on our ability to take your unique spaces and creative innovative designs that will fulfill your every fencing need â and all at an affordable price.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:group {\"className\":\"home-columns\"} -->\n<div class=\"wp-block-group home-columns\"><div class=\"wp-block-group__inner-container\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:html -->\n<i class=\"las la-balance-scale animate__zoomIn\"></i>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Are you worried about compliance with the current local governmental regulations on pool fencing? No need to fret; we have you covered. Our experience and in-depth knowledge of the swimming pool industry and its nuances ensure that youâll pass inspection. Weâll gladly work with your certifier if necessary and make sure that your property is certified as quickly as possible. Weâre so confident youâll pass muster, that we guarantee your pool compliance.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:html -->\n<i class=\"las la-smile animate__lightSpeedInRight\"></i>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Our small, family-run business offers exceptional customer service. You can expect individual attention; we believe each client is unique and will have unique needs, as no two pools or yards are the same. Weâre responsive, care about getting the job done right, and look forward to your satisfaction. Regardless of whether youâre looking for Colorbond fencing in Brisbane, glass pool fencing in Brisbane, or timber fencing in Brisbane, when you work with Northern Suburbs Fencing, you can expect unparalleled efficiency, quality of service, and value for your dollar.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:cover {\"url\":\"https://northernsuburbsfencing.local/wp-content/uploads/2021/02/grey-colourbond-yard.jpg\",\"id\":20,\"className\":\"home-hero\"} -->\n<div class=\"wp-block-cover has-background-dim home-hero\" style=\"background-image:url(https://northernsuburbsfencing.local/wp-content/uploads/2021/02/grey-colourbond-yard.jpg)\"><div class=\"wp-block-cover__inner-container\"><!-- wp:heading -->\n<h2>Are you in the market for fencing?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"home-hero secondary-hero\"} -->\n<p class=\"home-hero secondary-hero\">So, if youâre in the market for pool fencing, timber fencing, glass fencing, Colorbond fencing, chainwire fencing, an automatic gate installation, or any fencing at all in the Brisbane area, be sure to contact Northern Suburbs Fencing, for a personalized, affordable, efficient solution. Contact us now for your free, no-obligation quote on a timber, ColorbondÂ®, chainwire, or glass fence.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover -->','Home','','publish','closed','closed','','home','','','2021-03-12 23:13:40','2021-03-12 23:13:40','',0,'https://northernsuburbsfencing.local/?page_id=27',0,'page','',0);
